CREATE TABLE countries (
"code" varchar(2) NOT NULL default '',
"englishName" varchar(100) NOT NULL default '',
"arabicName" varchar(100) NOT NULL default '',
"englishNationality" varchar(100) NOT NULL default '',
"arabicNationality" varchar(100) NOT NULL default '',
PRIMARY KEY ("code")
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
